import React from 'react';
import './App.css';
import Masthead from '../MastHead/MastHead.js';
import '@patternfly/react-core/dist/styles/base.css';
import {
  Text
} from '@patternfly/react-core';
import Carousel from '../Carousel/Carousel.js';
import {KebabDropdown} from '../Spotlight/Spotlight.js'

class App extends React.Component {
  render() {
    const header = {
      height:"60px",
      width: "302px",
    }

    return (
      <div>
        <Masthead></Masthead>
        <Text>
        Events of the Week
        </Text>
        <Carousel>
        </Carousel>
        <KebabDropdown></KebabDropdown>
      </div>
    );
  }
}

export default App;

